pragma solidity ^0.5.0;

contract MasterPOC {

  address[] public contracts;
  address public lastContractAddress;

  event newProofClaimContract (
      address contractAddress
  );

  constructor()
      public
  {
  }

  function getContractCount()
      public
      view
      returns(uint contractCount)
  {
    return contracts.length;
  }

  function newProofClaim(string memory symbol, string memory name, address owner)
      public
      returns(bool)
  {
    uint supply = 100*1e18;
    ProofClaim c = new ProofClaim(symbol, name, owner, supply);
    contracts.push(address(c));
    lastContractAddress = address(c);

    emit newProofClaimContract(address(c));
    return true;
  }

  function seeProofClaim(uint pos)
      public
      view
      returns(address contractAddress)
  {
    return address(contracts[pos]);
  }
}

contract SafeMath {
function safeAdd(uint a, uint b) public pure returns (uint c) {
    c = a + b;
    require(c >= a);
}
function safeSub(uint a, uint b) public pure returns (uint c) {
    require(b <= a);
    c = a - b;
}
function safeMul(uint a, uint b) public pure returns (uint c) {
    c = a * b;
    require(a == 0 || c / a == b);
}
function safeDiv(uint a, uint b) public pure returns (uint c) {
    require(b > 0);
    c = a / b;
}
}

contract ERC20Interface {
	function totalSupply() public view returns (uint);
	function balanceOf(address tokenOwner) public view returns (uint balance);
	function allowance(address tokenOwner, address spender) public view returns (uint remaining);
	function transfer(address to, uint tokens) public returns (bool success);
	function approve(address spender, uint tokens) public returns (bool success);
	function transferFrom(address from, address to, uint tokens) public returns (bool success);

	event Transfer(address indexed from, address indexed to, uint tokens);
	event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
}

contract ApproveAndCallFallBack {
	function receiveApproval(address from, uint256 tokens, address token, bytes memory data) public;
}

contract Owned {
	address public owner;
	address public newOwner;

	event OwnershipTransferred(address indexed _from, address indexed _to);

	constructor() public {
    	owner = msg.sender;
	}

	modifier onlyOwner {
    	require(msg.sender == owner);
    	_;
	}

	function transferOwnership(address _newOwner) public onlyOwner {
    	newOwner = _newOwner;
	}
	function acceptOwnership() public {
    	require(msg.sender == newOwner);
    	emit OwnershipTransferred(owner, newOwner);
    	owner = newOwner;
    	newOwner = address(0);
	}
}

contract ProofClaim is ERC20Interface, Owned, SafeMath {
	string public symbol;
	string public  name;
	uint8 public decimals;
	uint public _totalSupply;

	mapping(address => uint) balances;
	mapping(address => mapping(address => uint)) allowed;
	mapping(address => uint) amountPaid;

constructor(string memory _symbol, string memory _name, address _owner, uint _supply) public {
    	symbol = _symbol;
    	name = _name;
    	decimals = 18;
    	_totalSupply = _supply;
    	balances[_owner] = _totalSupply;
    	emit Transfer(address(0), _owner, _totalSupply);
}

function totalSupply() public view returns (uint) {
    	return _totalSupply  - balances[address(0)];
}

function balanceOf(address tokenOwner) public view returns (uint balance) {
    	return balances[tokenOwner];
}

function transfer(address to, uint tokens) public returns (bool success) {
    	balances[msg.sender] = safeSub(balances[msg.sender], tokens);
    	balances[to] = safeAdd(balances[to], tokens);
    	emit Transfer(msg.sender, to, tokens);
    	return true;
}

function approve(address spender, uint tokens) public returns (bool success) {
    	allowed[msg.sender][spender] = tokens;
    	emit Approval(msg.sender, spender, tokens);
    	return true;
}

function transferFrom(address from, address to, uint tokens) public returns (bool success) {
    	balances[from] = safeSub(balances[from], tokens);
    	allowed[from][msg.sender] = safeSub(allowed[from][msg.sender], tokens);
    	balances[to] = safeAdd(balances[to], tokens);
    	emit Transfer(from, to, tokens);
    	return true;
}

function allowance(address tokenOwner, address spender) public view returns (uint remaining) {
    	return allowed[tokenOwner][spender];
}

function approveAndCall(address spender, uint tokens, bytes memory data) public returns (bool success) {
    	allowed[msg.sender][spender] = tokens;
    	emit Approval(msg.sender, spender, tokens);
    	ApproveAndCallFallBack(spender).receiveApproval(msg.sender, tokens, address(this), data);
    	return true;
}

function () external payable {
    	revert();
}

function transferAnyERC20Token(address tokenAddress, uint tokens) public onlyOwner returns (bool success) {
    	return ERC20Interface(tokenAddress).transfer(owner, tokens);
	}

function disbursePayment(address[] memory _addresses) public payable {
		for (uint i = 0; i < _addresses.length; i++) {
			address payable _addr = address(uint160(_addresses[i]));
			uint balance = balances[_addresses[i]];
			uint paymentAmount = msg.value*balance/_totalSupply;
			_addr.transfer(paymentAmount);
			amountPaid[_addr] = amountPaid[_addr] + paymentAmount;
		}
	}		

function getAmountPaid(address _address) public returns (uint) { 
		return amountPaid[_address]; 
	}
}
